import header__logo from '../../images/header__logo.svg';
import { NavLink } from 'react-router-dom';

function Header(props) {
    return (
        <header className="header">
            <img className="header__logo" src={header__logo} alt="Логотип" />
            {/* неавторизированый */}
            <div className="header__container">
                <NavLink className="UnauthorizedHeader__link" to={`/${props?.path}`} onClick={props?.signOut} >Регистрация</NavLink>
                <NavLink className="UnauthorizedHeader__link UnauthorizedHeader__enter-button" to={`/${props?.path}`} onClick={props?.signOut} >
                    Войти
                </NavLink>
            </div>
            {/* авторезированый */}
        </header>
    )
}

export default Header
